import React from 'react';
import './Avatar.css';
import Avatarlist from './Avatarlist';
import 'tachyons';

const Avatar = () => {
    return(
        <div>
        <h1> Welcome to Avatar World </h1>
        <Avatarlist id="1" name="Deepak" work="Web Developer"/>
        <button> Subscribe </button>
        </div>
    )
}

export default Avatar;
